<script>
const books = JSON.parse(document.getElementById('data').textContent);
function prepare(){
 const pages=books.map(b=>b.pages);
 const rating=books.map(b=>b.rating);
 const titles=books.map(b=>b.title);
 const titleLen=books.map(b=>b.title.length);
 const total=books.map(b=>b.totalratings);
 const logtotal=total.map(t=>Math.log10(t+1));
 const sorted=[...total].sort((a,b)=>a-b);
 const threshold=sorted[Math.floor(sorted.length*0.2)];
 window.metrics={pages,rating,titles,titleLen,total,logtotal,threshold};
}
function scatter(x,y,text,color){
 return {x,y,mode:'markers',marker:{size:6,color:color,line:{width:0}},text,hovertemplate:'%{text}<extra></extra>'};
}
function plot1(){
 Plotly.newPlot('plot1',[scatter(metrics.pages,metrics.rating,metrics.titles.map((t,i)=>`${t}<br>Rating: ${metrics.rating[i]}`),'rgba(0,150,136,0.3)')],{title:'<b>Page-count vs Average-rating</b>',xaxis:{title:'Pages',gridcolor:'rgba(0,0,0,0.1)'},yaxis:{title:'Average rating',gridcolor:'rgba(0,0,0,0.1)'},margin:{t:50}});
}
function plot2(){
 Plotly.newPlot('plot2',[scatter(metrics.titleLen,metrics.rating,metrics.titles.map((t,i)=>`${t}<br>Rating: ${metrics.rating[i]}<br>Length: ${metrics.titleLen[i]}`),'rgba(0,150,136,0.3)')],{title:'<b>Title-length vs Average-rating</b>',xaxis:{title:'Title length',gridcolor:'rgba(0,0,0,0.1)'},yaxis:{title:'Average rating',gridcolor:'rgba(0,0,0,0.1)'},margin:{t:50}});
}
function plot3(){
 const gemsOnly=document.getElementById('gemToggle').checked;
 const gemIdx=books.map((b,i)=>b.rating>=4.4 && b.totalratings<=metrics.threshold?i:-1).filter(i=>i>=0);
 const othersIdx=books.map((b,i)=>b.rating<4.4 || b.totalratings>metrics.threshold?i:-1).filter(i=>i>=0);
 const data=[];
 if(!gemsOnly){
  data.push(scatter(othersIdx.map(i=>metrics.logtotal[i]),othersIdx.map(i=>metrics.rating[i]),othersIdx.map(i=>`${metrics.titles[i]}<br>Rating: ${metrics.rating[i]}<br>Total ratings: ${metrics.total[i]}`),'rgba(70,130,180,0.3)'));
 }
 data.push(scatter(gemIdx.map(i=>metrics.logtotal[i]),gemIdx.map(i=>metrics.rating[i]),gemIdx.map(i=>`${metrics.titles[i]}<br>Rating: ${metrics.rating[i]}<br>Total ratings: ${metrics.total[i]}`),'rgba(255,152,0,0.6)'));
 Plotly.newPlot('plot3',data,{title:'<b>log10(Total-ratings+1) vs Average-rating</b>',xaxis:{title:'log10(Total ratings + 1)',gridcolor:'rgba(0,0,0,0.1)'},yaxis:{title:'Average rating',gridcolor:'rgba(0,0,0,0.1)'},margin:{t:50}});
}
document.getElementById('gemToggle').addEventListener('change',plot3);
prepare();
plot1();
plot2();
plot3();
</script>
